import React from 'react'
import { useLocation, useNavigate } from "react-router-dom";
import Login from '../components/Login';

import { loggedIn, setTokens, getAccessToken } from '../utils/localstorage';
import { checkExpired } from '../utils/spotify'
const Home = () => {
    let navigate = useNavigate();
    const location = useLocation();
    const params = new URLSearchParams(location.search);
    var accessToken = params.get("accessToken")
    var refreshToken = params.get("refreshToken")
    var expiresIn = params.get("expiresIn")

    if (!loggedIn() && accessToken != null && refreshToken != null && expiresIn != null) {
        setTokens(accessToken, refreshToken)
        navigate('/login')
    }

    if (loggedIn()) {
        ({ accessToken } = getAccessToken());
        checkExpired()
        return (
            <div>
                {accessToken}
            </div>
        )
    }
    else return (<Login />)
}

export default Home
